import React from 'react';
import "./ExpenseFilter.css"

const ExpenseFilter = ({onSelectedYear}) => {


    return (
        <div className='expenses-filter'>
            <div className='expenses-filter__control'>
                <label>Filter by year</label>
                <select>

                    <option value='2022' onSelect={onSelectedYear}>2022</option>
                    <option value='2021' onClick={onSelectedYear}>2021</option>
                    <option value='2020' onClick={onSelectedYear}>2020</option>
                    <option value='2019' onClick={onSelectedYear}>2019</option>
                </select>
            </div>
        </div>
    );
};

export default ExpenseFilter
